import React,{ Component,Fragment } from 'react'

import classes from './buttonList.css';
import Button from '../../components/Button/Button'
import {connect} from 'react-redux'

import * as actionTypes from '../../store/action'

class ButtonList extends Component {


    render() {
        return (
            <div className={classes.buttons}>
                <div className={classes.row}>
                    <Button value="7" clicked={() => this.props.calcNumbers(actionTypes.SEVEN)}/>
                    <Button value="8" clicked={() => this.props.calcNumbers(actionTypes.EIGHT)}/>
                    <Button value="9" clicked={() => this.props.calcNumbers(actionTypes.NINE)}/>
                    <Button value="+" clicked={() => this.props.calcNumbers(actionTypes.ADD)}/>
                </div>
                <div className={classes.row}>
                    <Button value="4" clicked={() => this.props.calcNumbers(actionTypes.FOUR)}/>
                    <Button value="5" clicked={() => this.props.calcNumbers(actionTypes.FIVE)}/>
                    <Button value="6" clicked={() => this.props.calcNumbers(actionTypes.SIX)}/>
                    <Button value="-" clicked={() => this.props.calcNumbers(actionTypes.SUBTRACT)}/>
                </div>
                <div className={classes.row}>
                    <Button id="one" value="1" clicked={() => this.props.calcNumbers(actionTypes.ONE)}/>
                    <Button id="two" value="2" clicked={() => this.props.calcNumbers(actionTypes.TWO)}/>
                    <Button id="three" value="3" clicked={() => this.props.calcNumbers(actionTypes.THREE)}/>
                    <Button value="*" clicked={() => this.props.calcNumbers(actionTypes.MULTIPLY)}/>
                </div>
                <div className={classes.row}>
                    <Button id="zero" value="0" clicked={() => this.props.calcNumbers(actionTypes.ZERO)}/>
                    <Button value="C" clicked={() => this.props.calcNumbers(actionTypes.CLEAR)}/>
                    <Button value="/" clicked={() => this.props.calcNumbers(actionTypes.DIVIDE)}/>
                    <Button id="equals" value="=" clicked={() => this.props.calcNumbers(actionTypes.EQUAL)}/>
                </div>
            </div>
        );
    }
}
const mapDispatchToProps = dispatch => {
    return {
        calcNumbers: (number) => dispatch({type:number})
    }
};
export default connect(null,mapDispatchToProps)(ButtonList);
